MongoDb: Pipeline inside lookup error: Error: Arguments must be aggregate pipeline operators<p>I have these three models:</p>
<ol>
<li><code>Institution</code> model:</li>
</ol>
<pre class="lang-js prettyprint-override"><code>const InstitutionSchema = new Schema({
  current_students: [
    {
      type: Schema.Types.ObjectId,
      ref: &quot;users&quot;,
    },
  ],
});

module.exports = Institution = mongoose.model(&quot;institutions&quot;, InstitutionSchema);
</code></pre>
<p>which has array of references to <code>User</code> model in <code>current_students</code> field.</p>
<ol start="2">
<li><code>User</code> model:</li>
</ol>
<pre class="lang-js prettyprint-override"><code>const UserSchema = new Schema({
  profile: {
    type: Schema.Types.ObjectId,
    ref: &quot;profiles&quot;,
  },
});

module.exports = User = mongoose.model(&quot;users&quot;, UserSchema);
</code></pre>
<p>which has references to <code>Profile</code> model in <code>profile</code> field.</p>
<ol start="3">
<li><code>Profile</code> model:</li>
</ol>
<pre class="lang-js prettyprint-override"><code>const ProfileSchema = new Schema({
  videoURL: {
    type: String,
  },
});

module.exports = Profile = mongoose.model(&quot;profiles&quot;, ProfileSchema);
</code></pre>
<p>I am trying to get the list of profiles for users of an institution where <code>Profile.videoURL</code> is not <code>null</code> or <code>undefined</code>. This is what I have tried:</p>
<pre class="lang-js prettyprint-override"><code>Institution.aggregate([
  {
    $lookup: {
      from: &quot;users&quot;,
      localField: &quot;current_students&quot;,
      foreignField: &quot;_id&quot;,
      as: &quot;current_student&quot;,
    },
  },
  {
    $unwind: {
      path: &quot;$current_student&quot;,
      preserveNullAndEmptyArrays: true,
    },
  },
  {
    $lookup: {
      from: &quot;profiles&quot;,
      localField: &quot;current_student.profile&quot;,
      foreignField: &quot;_id&quot;,
      as: &quot;current_student_profile&quot;,
    },
    pipeline: [
      {
        $match: {
          videoURL: { $nin: [undefined, null] },
        },
      },
    ],
  },
]);
</code></pre>
<p>However, I keep getting this error because of the last pipeline that executes the <code>$match</code> operation.</p>
<pre><code>Error: Arguments must be aggregate pipeline operators
</code></pre>
<p>Any idea how to fix this?</p>

