How to sum the values from a field in subdocuments from an array?<p>How do I project only the words found in each document from any of the keywords provided? The structure of the document is as follows:</p>
<pre><code>{
    _id: 24752893,
    dictionary: [
        {
            word: 'word1',
            count: 2,
        },
        {   
            word: 'word2',
            count: 5,
        },
        {
            word: 'word4',
            count: 1,
        },
        ....
    ]
},
{
    _id: 6786765789,
    dictionary: [
        {
            word: 'word4',
            count: 3,
        },
        {
            word: 'word2',
            count: 6,
        },
        {
            word: 'word3',
            count: 3,
        },
        {
            word: 'word5',
            count: 1,
        },
        ....
    ]
},
........
{
    _id: 76675567,
    dictionary: [
        {
            word: 'word1',
            count: 7,
        },
        {
            word: 'word3',
            count: 2,
        },
        ....
    ]
}
</code></pre>
<p>If a list of keywords like <strong>['word2', 'word3']</strong> is given, and a document should be retrieved whenever any of the words in the keyword list is found in it. I have written this aggregation pipeline to get the necessary documents:</p>
<pre><code>client.database.collection.aggregate([
    {
    '$project': {
        '_id': 1,
        'dictionary': {
            '$filter': {
                'input': '$dictionary',
                'as': 'words',
                'cond': {
                    '$in': [
                        '$$words.word', keywords
                    ]
                }
            }
        },
    }
},
{
    '$match': {
        'dictionary': {
            '$ne': []
        }
    }
},
,
{
    '$unwind': '$dictionary'
},
{
    '$group': {
        '_id': '$_id',
        'score': {
            '$sum': '$dictionary.count'
        }
    }
}
])
</code></pre>
<p>What I want to do is instead of projecting the whole dictionary, I want to project only the matching words for each document along with its count. And of course, I want the dictionary for each document to be in separate projected documents. Is there any way to do this?</p>

