Prevent _id field from being supplied in a MongoDB query<p>I'm using Mongoose in NodeJS to control a MongoDB database.</p>
<p>I'm creating an API and for obvious security reasons, I want to prevent the auto generated document <code>_id</code> field from getting replaced by a manually generated one in the API request.</p>
<p>Schema:</p>
<pre><code>{ name: String }
</code></pre>
<p>Creating a document:</p>
<pre><code>const record = {
    _id: '5e35517cc894c90327a34baf'
    name: 'bob'
}

const insertRecords = async () =&gt; {
    await Quiz.create(record);
};

insertRecords();
</code></pre>
<p>Results in the following document:</p>
<pre><code>{
   _id: '5e35517cc894c90327a34baf'
   name: 'bob'
}
</code></pre>
<p>As can be seen, the <code>_id</code> supplied in the query, as long as it's a valid ObjectID, would replace the <code>_id</code> that was supposed to be auto generated by mongo.</p>
<p>Is there a way to check if this <code>_id</code> field is in the query so that I can reject the API request? The <code>.create</code> method triggers the pre <code>save</code> middleware hook which would always have the <code>_id</code> of the final document so I cannot depend on it to know whether the <code>_id</code> was in the query or it's the auto generated one.</p>
<p>The only option I found is to disable the <code>_id</code> field altogether but this does not make sense.</p>

