MongoDB 4.4.4 change stream returns all document updates rather than filtered condition matched one?<p>I am looking for notifications of a single document's 'update' operation within a collection, supposedly when that particular document gets updated MongoDB would notify a 'watch' registered .net client, but the reality is MongoDB returns all documents with 'update' operations in the collection, no matter how the &quot;match&quot; condition of filter sets.</p>
<p>Can anyone with Change Stream experience help? Is it the nature/design of MongoDB change stream?</p>
<p>Below is the test code pieces of .net C# client,</p>
<p>The class:</p>
<pre><code>public class UserInfo
{
        [BsonId, BsonRepresentation(BsonType.ObjectId)]
        public string Id { get; set; }

        [BsonElement(&quot;UserName&quot;, Order = 1), BsonRepresentation(BsonType.String)]
        public string UserName { get; set; }

        [BsonElement(&quot;Password&quot;, Order = 2), BsonRepresentation(BsonType.String)]
        public string Password { get; set; }

        [BsonElement(&quot;LastName&quot;, Order = 3), BsonRepresentation(BsonType.String)]
        public string LastName { get; set; }

        [BsonElement(&quot;FirstName&quot;, Order = 4), BsonRepresentation(BsonType.String)]
        public string FirstName { get; set; }

        [BsonElement(&quot;Email&quot;, Order = 5), BsonRepresentation(BsonType.String)]
        public string Email { get; set; }
}
</code></pre>
<p>Pipeline of filter conditions:</p>
<pre><code>collection = myDB.GetCollection&lt;UserInfo&gt;(&quot;Users&quot;);
var options = new ChangeStreamOptions
            {
                FullDocument = ChangeStreamFullDocumentOption.UpdateLookup,
            };
var pipeline = new EmptyPipelineDefinition&lt;ChangeStreamDocument&lt;UserInfo&gt;&gt;();
pipeline.Match(g =&gt; g.OperationType == ChangeStreamOperationType.Update)
        .Match(o =&gt; o.FullDocument.UserName.Contains(&quot;Alice&quot;))
        .Match(t =&gt; t.UpdateDescription.UpdatedFields.ToString().Contains(nameof(UserInfo.Password)));

Task watchTask = WatchCollection();
</code></pre>
<p>Change event process routine:</p>
<pre><code>private static async Task WatchCollection()
{
            var cursor =  await collection.WatchAsync(pipeline, options);
            Debug.WriteLine(&quot;ChangeStream started.&quot;);

            await cursor.ForEachAsync(change =&gt;
            {
                Debug.WriteLine(&quot;Matched UserName: &quot; + change.FullDocument.UserName);
            });
}
</code></pre>
<p>From the above routine, change events aren't working according to the filter conditions, every time this routine gets triggered, 'change.FullDocument.UserName' actually prints out every document in the collection that gets 'update' operation, which is quite weird.</p>

