Server sent an invalid nonce when making multiple rapid connections from C# driver<p>I recently added authentication to my development database, authenticating against the &quot;admin&quot; database, and using a username/password combination in my connection string, e.g. <code>mongodb://username:password@server:27017</code>. Almost immediately I started seeing connections failing to open with an exception showing &quot;Server sent an invalid nonce&quot;. To try and mitigate the problem I looked at the lifetime of my IMongoClient objects, and moved from instantiating many such objects to using a Singleton injected into my business services using the Microsoft.Extensions.DependencyInjection libraries. This hasn't alleviated the issue. I set up the MongoClient in my Startup.cs using <code>.AddSingleton&lt;IMongoClient&gt;(factory =&gt; new MongoClient(Configuration[&quot;Storage:MongoConnectionString&quot;]))</code>. I know that the connection string is correct as it works in MongoDB Compass, and also because the first couple of calls through the driver work successfully; the issue starts occuring when multiple concurrent calls are in progress.</p>
<p>I am using the MongoDB .NET driver, version 2.11.0, under .NET Core 3.1.2. The problem occurs in my local environment running Windows 10, and also my staging environment running inside Docker on VMware Photon.</p>
<p>There are two components of the app that make connnections to MongoDB, both of which are ASP.Net Core applications, one serving an API for interactive usage of my applicaiton, and one running a Quartz scheduler for background processing. I'm running MongoDB 4.4.0 Community inside a Docker container.</p>
<p>My references to include the driver are:</p>
<pre><code>&lt;PackageReference Include=&quot;MongoDB.Bson&quot; Version=&quot;2.11.0&quot; /&gt;
&lt;PackageReference Include=&quot;MongoDB.Driver&quot; Version=&quot;2.11.0&quot; /&gt;
&lt;PackageReference Include=&quot;MongoDB.Driver.Core&quot; Version=&quot;2.11.0&quot; /&gt;
</code></pre>
<p>According to <a href="https://jira.mongodb.org/browse/CSHARP-2358" rel="nofollow noreferrer">this post on the MongoDB Jira site</a> I'm not the first person to experience this issue. Mathias Lorenzen suggested in the issue on Jira that he had reduced the number of errors he encountered with various fixes including recreating the user, using SCRAM-SHA-1, and increasing the maximum number of connections permitted on the server. With these changes in place, the issue still occurs for me.</p>
<p>I'm guessing that the problem is related to threading when used in conjunction with database authentication. I can't, for obvious reasons, put this code into production use by disabling authentication to work around the problem, and equally the use of a synchronous model rather than async seems counter-productive. What steps can I take to try and resolve the authentication issues? Is this likely to be a bug in the Mongo C# driver, or am I simply using it wrong.</p>
<p>Insight on what I can try next, or alternative approaches, would be gratefully received.</p>
<hr />
<p>Edit: Minimum reproducible example as requested:</p>
<pre><code>using System;
using System.Collections.Generic;
using System.Threading.Tasks;
using Microsoft.Extensions.DependencyInjection;
using MongoDB.Driver;

namespace MongoDbIssueExample
{
    internal class Program
    {
        private static IServiceProvider services;

        private static IServiceProvider BuildDependencyInjector()
        {
            services = new ServiceCollection()
                .AddSingleton&lt;TestThingsService&gt;()
                .AddSingleton&lt;IMongoClient&gt;(factory =&gt; new MongoClient(&quot;mongodb://username:password@server:27017&quot;))
                .BuildServiceProvider();

            return services;
        }

        private static async Task DoSeed()
        {
            var service = services.GetService&lt;TestThingsService&gt;();
            // Don't do these async as we'll never get any data in...
            service.CreateTestThings().Wait();
            service.CreateOtherTestThings().Wait();
        }

        private static async Task DoTest()
        {
            var service = services.GetService&lt;TestThingsService&gt;();

            var things = service.GetTestThings();
            var otherThings = service.GetOtherTestThings();

            Task.WaitAll(things, otherThings);
        }

        private static async Task Main(string[] args)
        {
            BuildDependencyInjector();

            await DoTest();
        }
    }

    public class TestThingsService
    {
        private readonly IMongoClient _client;
        private readonly IMongoDatabase _database;
        private readonly IMongoCollection&lt;OtherTestThing&gt; _otherTestThingsCollection;
        private readonly IMongoCollection&lt;TestThing&gt; _testThingsCollection;

        public TestThingsService(IMongoClient client)
        {
            _client = client;
            _database = _client.GetDatabase(&quot;Things&quot;);
            _testThingsCollection = _database.GetCollection&lt;TestThing&gt;(&quot;TestThings&quot;);
            _otherTestThingsCollection = _database.GetCollection&lt;OtherTestThing&gt;(&quot;OtherTestThings&quot;);
        }

        public async Task CreateOtherTestThings()
        {
            for (var item = 1; item &lt;= 10000; item++)
            {
                var testThing = new OtherTestThing {Id = item, Name = $&quot;Other thing no. {item}&quot;, WhenCreated = DateTime.UtcNow};
                await _otherTestThingsCollection.ReplaceOneAsync(f =&gt; f.Id == item, testThing, new ReplaceOptions {IsUpsert = true});
            }
        }

        public async Task CreateTestThings()
        {
            for (var item = 1; item &lt;= 10000; item++)
            {
                var testThing = new TestThing {Id = item, Name = $&quot;Thing no. {item}&quot;, WhenCreated = DateTime.UtcNow};
                await _testThingsCollection.ReplaceOneAsync(f =&gt; f.Id == item, testThing, new ReplaceOptions {IsUpsert = true});
            }
        }


        public async Task&lt;List&lt;OtherTestThing&gt;&gt; GetOtherTestThings()
        {
            return await _otherTestThingsCollection.Find(_ =&gt; true).ToListAsync();
        }

        public async Task&lt;List&lt;TestThing&gt;&gt; GetTestThings()
        {
            return await _testThingsCollection.Find(_ =&gt; true).ToListAsync();
        }
    }

    public class OtherTestThing
    {
        public int Id { get; set; }
        public string Name { get; set; }
        public DateTime WhenCreated { get; set; }
    }

    public class TestThing
    {
        public int Id { get; set; }
        public string Name { get; set; }
        public DateTime WhenCreated { get; set; }
    }
}
