Mongo throwing write conflicts for concurrent sessions<pre><code> session.StartTransaction();
 await mongo.Collection1.UpdateOneAsync(session, filter1, update1);
 await mongo.Collection2.BulkWriteAsync(session, updatesToDifferentDocs);
 await mongo.Collection3.UpdateOneAsync(session, filter2, update2);
 await session.CommitTransactionAsync();
</code></pre>
<p>The above code is running concurrently on multiple threads. The final update for <code>Collection3</code> has a high chance of writing on the same document by multiple threads. I wanted the transactions across the 3 collections to be atomic which is why I put them in one session, which is what I thought session is essentially used for, however, I'm not familiar with the details of its inner-workings.</p>
<p>Without knowing much about the built-in features of Mongo. It's pretty obvious why this is giving me a write conflict. I simply can't write to the same document in <code>Collection3</code> at the same time on multiple threads.</p>
<p>However, I tried Googling a bit and it seems like Mongo &gt;= 3.2 has WiredTiger Storage Engine by default which has Document level locks that doesn't need to be used by the developer. I've read that it automatically retries the transaction if the document was initially locked.</p>
<p>I don't really know if I'm using <code>session</code> incorrectly here, or I just have to manually implement some kind of lock/semaphore/queue system. Another option would be to manually check for write conflict and re-attempt the entire session. But it feels like I'm just reinventing the wheel here if Mongo is already supposed to have concurrency support.</p>

